svg.script:
let info_elements = document.querySelectorAll('.composition_info');
let current_element = 0;
let previous_element = (current_element - 1 + info_elements.length) % info_elements.length;

let interval = 2000;
let timer_handler;

function runAnimation() {
    // calculate previous element

    // change display style
    info_elements[previous_element].style.display = 'none';
    info_elements[current_element].style.display = 'inline';

    // update index of current element
    current_element = (current_element + 1) % info_elements.length;
    previous_element = (previous_element + 1) % info_elements.length;

    // execute next animation interation
    timer_handler = setTimeout(runAnimation, interval)
}

function startAnimation() {
    timer_handler = setTimeout(runAnimation, 100)
}

function stopAnimation() {
    clearTimeout(timer_handler)
    for(let i = 0; i < info_elements.length; i++) {
        // unset attribute to be overwritable by CSS
        info_elements[i].style.display = null;
    }
}

startAnimation()
